import React from "react";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";

const Header = () => {
  const navStyle = { color: 'white' };

  return (
    <div style={{ background: 'black' }}>
      <Navbar>
        <Container>
          <Navbar.Brand href="#home">
            <img
              src="https://samcenter.vn/images/thumbs/0005426_0003182_logo (2).png"
              alt=""
              width={100}
            />
          </Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto center">
              <Nav.Link href="#home" style={navStyle}>Samsung Galaxy</Nav.Link>
              <Nav.Link href="#link" style={navStyle}>Galaxy Watch</Nav.Link>             
              <Nav.Link href="#link" style={navStyle}>Galaxy Tab</Nav.Link>
              <Nav.Link href="#link" style={navStyle}>Galaxy Buds</Nav.Link>
              <Nav.Link href="#link" style={navStyle}>Phụ kiện</Nav.Link>
              <Nav.Link href="#link" style={navStyle}>Dịch vụ</Nav.Link>
              <Nav.Link href="#link" style={navStyle}>Hot</Nav.Link>
              <Nav.Link href="#link" style={navStyle}>Tin tức</Nav.Link>

            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </div>
  );
};

export default Header;
